function createChartData(resultArr, pFeed, type) {
	var maxLines = 20;
	var ticker_count = pFeed.ticker.length;
	var stkCount = (ticker_count < maxLines) ? ticker_count : maxLines;
	//var resultArr = calcAllTechIndicators(pFeed.price);
	var chartDataString = displayDygraph(pFeed.ticker, pFeed.date, resultArr,
			type);
	return chartDataString;
}
function displayDygraph(tickerArr, oDateArr, resultArr, index) {
	var chartData;
	var dateArr = new Array();
	for ( var i = 0; i < oDateArr.length; i++) {
		var splitDateTime = oDateArr[i].split(" ");
		dateArr[i] = splitDateTime[0].replace(/\//g, "-");
	}
	dateArr.reverse();

	chartData = "Date,";
	for ( var t = 0; t < tickerArr.length; t++) {
		chartData += String(tickerArr[t]);
		if (t == tickerArr.length - 1) {
			chartData += "\n";

		} else {
			chartData += ",";
		}
	}

	for ( var k = 922; k < resultArr[0][index].length; k++) {
		chartData += String(dateArr[k]) + ",";
		for ( var st = 0; st < resultArr.length; st++) {
			chartData += String(resultArr[st][index][k]);

			if (st == resultArr.length - 1) {
				chartData += "\n";

			} else {
				chartData += ",";
			}

		}
	}
	return chartData;
}

