function calcAllTechIndicators(priceArray) {

	var resultMat = [];
	var priceArrayLength = priceArray.length;

	for ( var i = 0; i < priceArrayLength; i++) {

		priceArray[i].reverse();
		var resultMatRow = [];
		resultMatRow.push(calcPercentChange(priceArray[i]));
		resultMatRow.push(calcPriceChange(priceArray[i],'absolute'));
		resultMatRow.push(calcRSI(priceArray[i]));
		resultMatRow.push(calcSMAday(priceArray[i], '5'));
		resultMatRow.push(calcSMAday(priceArray[i], '30'));
		resultMatRow.push(calcEMAday(priceArray[i], '5'));
		resultMatRow.push(calcEMAday(priceArray[i], '30'));
		resultMatRow.push(calcStochOsc(priceArray[i]));
		resultMatRow.push(calcSMAofStochOsc(priceArray[i]));
		resultMatRow.push(calcROC(priceArray[i], '5'));
		resultMatRow.push(calcROC(priceArray[i], '30'));
		resultMatRow.push(calcKST(priceArray[i]));
		resultMatRow.push(calcTSI(priceArray[i]));
		resultMatRow.push(calcVolatility(priceArray[i], '30'));
		resultMat.push(resultMatRow);
		//reverse back
		priceArray[i].reverse();
	}

	//console.log(resultMat);
	return resultMat;
}

function calcPercentChange(priceArray) {
	var basePrice = priceArray[0];
	var resultChngArr = [];
	for ( var j = 0; j < priceArray.length; j++) {
		resultChngArr[j] = Math
				.round((((priceArray[j] - basePrice) / basePrice)) * 100) / 100;

	}
	return resultChngArr;
}

function calcPriceChange(priceArray, abs) {
	var priceChngArr = [];
	priceChngArr[0] = 0;
	for ( var j = 1; j < priceArray.length; j++) {
		if (abs != 'absolute') {
			priceChngArr[j] = Math
					.round(((priceArray[j] - priceArray[j - 1])) * 100) / 100;
		} else {
			priceChngArr[j] = Math.round(Math
					.abs((priceArray[j] - priceArray[j - 1])) * 100) / 100;
		}

	}

	return priceChngArr;
}

function calcTSI(priceArray) {
	var pcArr = [];
	pcArr = calcPriceChange(priceArray, 'none');

	var fsArr = [];
	fsArr = calcEMAday(pcArr, 25);

	var ssArr = [];
	ssArr = calcEMAday(fsArr, 13);

	
	var apcArr = [];
	apcArr = calcPriceChange(priceArray, 'absolute');

	var afsArr = [];
	afsArr = calcEMAday(apcArr, 25);
	var assArr = [];
	assArr = calcEMAday(afsArr, 13);

	var tsiArr = [];
	for (i = 0; i < assArr.length; i++) {
		tsiArr[i] = 100 * Math.round((ssArr[i] / assArr[i]) * 100) / 100;
	}
	return tsiArr;
}

function calcVolatility(priceArray, n) {

	n = parseInt(n);
	var resultVolArr = [];
	var priceArrayLength = priceArray.length;
	for ( var i = n; i < (priceArrayLength); i++) {
		var sum = 0;
		for ( var j = 0; j < n; j++) {
			sum += priceArray[i - j];
		}
		var sma = ~~(sum / n);
		var sumSqdDev = 0;
		for ( var j = 0; j < n; j++) {
			var price_sma = priceArray[i - j] - sma;
			sumSqdDev += Math.pow(price_sma, 2);
		}
		var stdDev = Math.round((Math.sqrt(sumSqdDev / n)) * 100) / 100;
		resultVolArr[i - n] = stdDev;
	}

	return resultVolArr;

}

function calcSMAday(priceArray, n) {
	var basePrice = priceArray[0];
	n = parseInt(n);
	var resultSmaArr = [];
	var priceArrayLength = priceArray.length;
	for ( var i = n; i < (priceArrayLength); i++) {
		var sum = 0;
		for ( var j = 0; j < n; j++) {
			sum += priceArray[i - j];
		}
		var sma = ~~(sum / n);
		resultSmaArr[i - n] = sma;

	}

	return resultSmaArr;
}

function calcEMAday(priceArray, n) {
	n = parseInt(n);
	var basePrice = priceArray[0];
	var multiplier = Math.round((2 / (n + 1)) * 100) / 100;
	var resultEmaArr = [];

	var sumnDay = 0;
	for ( var j = 0; j < 10; j++) {
		sumnDay += priceArray[n - 1 - j];
	}
	emaPrevDay = ~~(sumnDay / n);

	for ( var i = n; i < (priceArray.length); i++) {
		var currEMA = Math
				.round(((priceArray[i] - emaPrevDay) * multiplier + emaPrevDay) * 100) / 100;
		resultEmaArr[i - n] = currEMA;
		emaPrevDay = currEMA;
	}
	return resultEmaArr;
}

function calcKST(priceArray) {

	// RCMA1 = 10-Period SMA of 10-Period Rate-of-Change
	// RCMA2 = 10-Period SMA of 15-Period Rate-of-Change
	// RCMA3 = 10-Period SMA of 20-Period Rate-of-Change
	// RCMA4 = 15-Period SMA of 30-Period Rate-of-Change
	//
	// KST = (RCMA1 x 1) + (RCMA2 x 2) + (RCMA3 x 3) + (RCMA4 x 4)
	var ROC10 = calcROC(priceArray, '10');

	var RCMA1 = calcSMAday(ROC10, '10');

	var ROC15 = calcROC(priceArray, '15');
	var RCMA2 = calcSMAday(ROC15, '10');

	var ROC20 = calcROC(priceArray, '20');
	var RCMA3 = calcSMAday(ROC20, '10');

	var ROC30 = calcROC(priceArray, '30');
	var RCMA4 = calcSMAday(ROC30, '10');

	var KST = [];
	var RCMA4Length = RCMA4.length;
	for (i = 0; i < RCMA4Length; i++) {
		KST[i] = RCMA1[RCMA1.length - 1 - i] * 1
				+ (RCMA2[RCMA2.length - 1 - i] * 2)
				+ (RCMA3[RCMA3.length - 1 - i] * 3)
				+ (RCMA4[RCMA4.length - 1 - i] * 4);
	}
	return KST;

}

function calcROC(priceArray, n) {
	n = parseInt(n);
	var resultROCArr = [];
	var priceArrayLength = priceArray.length;
	for ( var i = n; i < priceArrayLength; i++) {
		resultROCArr[i - n] = Math
				.round((((priceArray[i] - priceArray[i - n]) / priceArray[i - n]) * 100) * 100) / 100;
	}
	return resultROCArr;
}

function calcStochOsc(priceArray) {
	Array.max = function(array) {
		return Math.max.apply(Math, array);
	};

	Array.min = function(array) {
		return Math.min.apply(Math, array);
	};
	var resultPercentKArr = [];

	for ( var i = 13; i < priceArray.length; i++) {
		var prev14Days = [];
		for (j = 0; j < 13; j++) {
			prev14Days[j] = priceArray[i - j];
		}
		var low = Array.min(prev14Days);
		var high = Array.max(prev14Days);
		percentK = ((priceArray[i] - low) / (high - low)) * 100;

		resultPercentKArr[i - 13] = percentK;
	}
	return resultPercentKArr;

}

function calcSMAofStochOsc(priceArray) {
	Array.max = function(array) {
		return Math.max.apply(Math, array);
	};

	Array.min = function(array) {
		return Math.min.apply(Math, array);
	};
	var resultPercentKArr = [];

	for ( var i = 13; i < priceArray.length; i++) {
		var prev14Days = [];
		for (j = 0; j < 13; j++) {
			prev14Days[j] = priceArray[i - j];
		}
		var low = Array.min(prev14Days);
		var high = Array.max(prev14Days);
		percentK = ((priceArray[i] - low) / (high - low)) * 100;

		resultPercentKArr[i - 13] = percentK;
	}
	var resultPercentDArr = [];
	resultPercentDArr = calcSMAday(resultPercentKArr, '3');
	return resultPercentDArr;
}

function calcRSI(priceArray) {
	var numGainDays = 0;
	var numLossDays = 0;
	var totalGain = 0;
	var totalLoss = 0;
	var resultRSIArr = [];
	var changeArr = [];
	var basePrice = priceArray[0];
	for ( var i = 13; i < priceArray.length; i++) {
		for ( var j = 0; j < 13; j++) {
			var prevClose = priceArray[i - 13];
			var currClose = priceArray[(i - 13) + 1];
			var absChange = currClose - prevClose;

			if (absChange >= 0) {
				numGainDays++;
				totalGain += absChange;
			} else {
				numLossDays++;
				totalLoss += Math.abs(absChange);
			}
		}
		changeArr[i] = Math
				.round((((priceArray[i] - basePrice) / basePrice)) * 100) / 100;

		var RS = (totalGain / 14) / (totalLoss / 14);
		var RSI14 = Math.round((100 - (100 / (1 + RS))) * 100) / 100;
		resultRSIArr[i - 13] = RSI14;

	}
	return resultRSIArr;

}

function calcVolatilityAsPercent(priceArray, n) {
	n = parseInt(n);
	var resultVolArr = [];
	for ( var i = n; i < (priceArray.length); i++) {
		var sum = 0;
		for ( var j = 0; j < n; j++) {
			sum += priceArray[i - j];
		}
		var sma = ~~(sum / n);
		var sumSqdDev = 0;
		for ( var j = 0; j < n; j++) {
			var price_sma = priceArray[i - j] - sma;
			sumSqdDev += Math.pow(price_sma, 2);
		}
		var stdDev = Math.round((Math.sqrt(sumSqdDev / n)) * 100) / 100;
		resultVolArr[i - n] = Math.round((stdDev / sma) * 100) / 100;
	}
	console.log(resultVolArr[0]);
	return resultVolArr;

}

