function ndist(z) {
	return Math.exp(-0.5 * z) / Math.sqrt(2 * Math.PI);
}

function N(z) {
	var a = 0;
	var b = 0;
	var t = 0;
	var n = 0;

	var b1 = 0.32;
	var b2 = -0.36;
	var b3 = 1.786;
	var b4 = -1.826;
	var b5 = 1.336;
	var p = 0.236;
	var c2 = 0.40;

	a = Math.abs(z);
	if (a > 6.0) {
		return 1.0;
	}

	b = c2 * Math.exp((-z) * (z / 2.0));
	t = 1.0 + (a * p);
	t = 1.0 / t;
	n = ((((b5 * t + b4) * t + b3) * t + b2) * t + b1) * t;
	n = 1.0 - b * n;
	if (z < 0) {
		n = 1.0 - n;
	}
	return n;
}

function black_scholes(call, S, X, r, v, t) {

	var gamma = 0;
	var vega = 0;
	var theta = 0;
	var rho = 0;
	var temp = 0;
	var sqt = 0
	var d1 = 0;
	var d2 = 0;

	var Nd2 = 0;
	var nd1 = 0;
	var ert = 0;
	var delta = 0; // The delta of the option

	sqt = Math.sqrt(t);
	d1 = (Math.log(S / X) + r * t) / (v * sqt) + 0.5 * (v * sqt);
	d2 = d1 - (v * sqt);

	if (call) {
		delta = N(d1);
		Nd2 = N(d2);
	} else { // put
		delta = -N(-d1);
		Nd2 = -N(-d2);
	}

	ert = Math.exp(-r * t);
	nd1 = ndist(d1);

	gamma = nd1 / (S * v * sqt);
	vega = S * sqt * nd1;
	theta = -(S * v * nd1) / (2 * sqt) - r * X * ert * Nd2;
	rho = X * t * ert * Nd2;
	temp = S * delta;
	temp -= X * ert * Nd2;
	return Math.round(temp * 100) / 100;

}

function calcAvgVolatility(priceArray) {
	var L = priceArray.length, i = 0, sum = 0;
	var sma = 0;
	var sumSqdDev = 0;
	var stdDev = 0;

	while (i < L) {
		sum += priceArray[i++];
	}
	sma = (sum / L);

	i = 0;
	while (i < L) {
		var tDiff = (priceArray[i++] - sma);
		sumSqdDev += tDiff * tDiff;
	}
	stdDev = Math.round((Math.sqrt(sumSqdDev / L)) * 100) / 100;
	return Math.round((stdDev / sma) * 100) / 100;
}

function calcVolatilityAsPercent(priceArray, n) {
	n = parseInt(n);

	var sma = 0;
	var sumSqdDev = 0;
	var stdDev = 0;
	var L = priceArray.length, i = 0, j = 0, sum = 0;

	var resultVolArr = new Array();
	for (i = n; i < L; i++) {
		sum = 0;
		for (j = 0; j < n; j++) {
			sum += priceArray[i - j];
		}
		sma = ~~(sum / n);
		sumSqdDev = 0;
		for (j = 0; j < n; j++) {
			//sumSqdDev += Math.pow((priceArray[i - j] - sma), 2);
			var price_sma = priceArray[i - j] - sma;
			sumSqdDev += price_sma * price_sma;
		}
		stdDev = Math.round((Math.sqrt(sumSqdDev / n)) * 100) / 100;
		resultVolArr[i - n] = Math.round((stdDev / sma) * 100) / 100;
	}
	i = 0;
	sum = 0;
	while (i < resultVolArr.length) {
		sum += resultVolArr[i++];
	}
	return Math.round((sum / resultVolArr.length) * 100) / 100;

}

